<p>一、全世界散户的通病，亏了死拿，稍微由亏转盈就会马上卖出，不看趋势，不看<code>成交量</code>，只看账户盈亏比，最后的结果就是亏损无限大，盈利有限小。需要反向操作，<code>盈利了死拿，稍微亏损就割掉</code>，我的止盈止损原则就是盈利 15%，利润跌倒 10%就止盈，继续涨就继续拿，让利润奔跑，如果买入后跌，亏损超过本金 5%就止损。如果你能保证每次止盈 10%，止损 5%，那么操作 100 次， 这样即便你的胜率只有 50%，你的收益也将达到 800%，难吗？难的是人的贪婪和恐惧， 知行合一！</p>
